import { TextField,InputBase, Input} from '@material-ui/core';
import React, { Component } from 'react';
import { }from "./Atribut";
import { BlueButton } from './Atribut';
import {Container,Form,Row,Col} from 'react-bootstrap/'

class FormRegis extends Component {
    render() {
        return (
           <div>
               <Form style={{margin: "0vw 5vw"}}>
                   <h4 style={{textAlign:"left",marginLeft:"8vw"}}>Masukan Data Diri</h4>
                    <Row>
                        <Col sm={6}>
                        <TextField
                            className="input"
                            label="Nama Depan"
                            style={{ margin: 8, disableUnderline: true }}
                            placeholder=""
                            fullWidth
                            inputProps={{
                                disableUnderline: true
                            }}
                            margin="normal"
                            InputLabelProps={{
                                shrink: true,
                            }}
                            />

                        </Col>
                        <Input />
                        <Col sm={6}>
                        <InputBase
                            label="Nama Depan"
                            className="input"
                            fullWidth

                            inputProps={{ 'aria-label': 'Masukkan daerah' }}
                        />

                        </Col>
                    </Row>
                </Form>
            </div>
        );
    }
}

export default FormRegis;
